INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0, 110, 122601, 1, 1, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 105, 1, 1, 1.5, 101, 160, 0.029, 0);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0, 105, 122401, 3, 2, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 111, 2, 0, 2.5, 102, 120, 0.014, 1);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (1, 110, 122501, 2, 3, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 105, 3, 0, 2.5, 103, 350, 0.017, 0);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0, 110, 107501, 3, 4, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 105, 4, 0, 1.5, 104, 130, 0.016, 1);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0, 110, 107601, 1, 5, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 105, 5, 1, 2.5, 105, 160, 0.014, 0);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (1, 120, 107801, 2, 6, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 103, 6, 0, 3.5, 106, 255, 0.029, 0);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0, 120, 110601, 1, 7, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 103, 7, 1, 3.5, 107, 160, 0.013, 0);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (1, 110, 110401, 2, 8, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 103, 8, 0, 2.5, 108, 350, 0.014, 0);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0, 105, 110501, 3, 9, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 100, 9, 0, 1.5, 109, 130, 0.012, 1);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0, 105, 115701, 1, 10, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 103, 10, 1, 2.5, 110, 200, 0.014, 0);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (1, 105, 113601, 2, 11, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 103, 11, 0, 2.5, 111, 350, 0.071, 0);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0, 120, 107901, 3, 12, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 103, 12, 0, 1.5, 112, 130, 0.014, 1);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0, 110, 108001, 2, 13, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 105, 13, 1, 1.5, 113, 200, 0.022, 0);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0, 110, 110301, 1, 14, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 108, 14, 1, 2.5, 114, 160, 0.031, 0);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0, 110, 107701, 1, 15, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 105, 15, 0, 0.5, 115, 130, 0.036, 1);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (1, 110, 113101, 2, 16, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 95, 16, 0, 3.5, 116, 350, 0.048, 0);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0, 105, 113301, 3, 17, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 105, 17, 0, 1.5, 117, 130, 0.043, 1);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0, 105, 113201, 2, 18, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 95, 18, 0, 1.5, 118, 130, 0.018, 1);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0, 110, 117001, 2, 19, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 108, 19, 1, 2.5, 119, 160, 0.021, 0);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (1, 110, 113501, 1, 20, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 105, 20, 0, 2.5, 120, 255, 0.036, 0);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (1, 105, 113401, 3, 21, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 105, 21, 0, 2.5, 121, 350, 0.02, 0);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0, 110, 110101, 1, 22, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 105, 22, 0, 2.5, 122, 130, 0.018, 1);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0, 105, 110001, 3, 23, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 111, 23, 1, 3.5, 123, 160, 0.03, 0);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0, 110, 117201, 1, 24, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 103, 24, 0, 1.5, 124, 130, 0.027, 1);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0, 105, 117301, 2, 25, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 108, 25, 1, 3.5, 125, 160, 0.02, 0);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (1, 110, 117401, 3, 26, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 105, 26, 0, 2.5, 126, 350, 0.04, 0);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (1, 110, 117101, 1, 27, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 105, 27, 0, 3.5, 127, 350, 0.009, 0);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (1, 120, 122901, 1, 28, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 105, 28, 0, 3.5, 128, 255, 0.022, 0);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0, 110, 122801, 3, 29, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 105, 29, 0, 2.5, 129, 130, 0.028, 1);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0, 105, 122701, 2, 30, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 108, 30, 1, 3.5, 130, 130, 0.023, 0);
